import React from 'react'
import Card from './Card';
import data from './Services_data';
// import '../public/'

function start(val){
    return(
        <Card
            name1={val.name}
            image1={val.image}
        />
    )
        
}

const Services = () => {
  return (
    data.map(start)
  )
}

export default Services
